Listing.where(vin: '1FMFU175X6LA52096').update_all(:title=>"2006 Ford Expedition", :description=>"There is plenty to like about our super-sized 2006 Ford Expedition in Oxford White! Let's talk about this V8 engine... Displacing 5.4 liters and making 300hp, this engine features a 3-valve head design that allows the engine to breathe better. As a result it now has more horsepower, torque, and better fuel economy. Don't forget ours is Real Wheel Drive so you can go wherever the highway may take you!  Our Eddie Bauer trim includes all the bells and whistles you can think of...AM/FM stereo, CD player, 3rd row seating, rear A/C vents and audio controls, and more! There is loads of room for you and your family!  While you're thinking about your child's safety, stop for a minute and think about yours, too. The Expedition is the only full-size SUV to score the highest frontal crash test rating 4 years in a row, dating back to 2001. If you get bored enough to start reading the dictionary, look up the word expedition - \"a journey undertaken by a group of people with a definite objective\". Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2006, :miles=>117052, :transmission=>"Automatic", :color=>"Oxford White", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>7999, :newused=>"Used", :vin=>"1FMFU175X6LA52096", :stocknumber=>"CCSJ068", :model=>"Expedition", :trim=>"Eddie Bauer", :enginedescription=>"5.4L 8 Cylinders", :interiorcolor=>"Medium Parchment", :options=>"Air Conditioning : Multi-Zone A/C,Audio : Am/Fm Stereo,Audio : Cd Player,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Convenienc