Listing.where(vin: 'JN8DR09X53W705244').update_all(:title=>"2003 Nissan Pathfinder", :description=>"Our One Owner, Clean Carfax, 2003 Nissan Pathfinder SE is a great mid-sized SUV for any occasion. This Pathfinder's power comes from a 3.5 Liter V6 for lots of get up and go! Mate this 240hp engine to a responsive and agile Automatic transmission, and you'll be pleased with the maneuverability that this Rear Drive SUV Nissan can provide you. Plus, you'll grin as you pass by that gas station thanks to the estimated fuel efficiency of 21mpg on the open road!   Our SE trimmed Pathfinder comes with an extensive list of comfort features, too! Slide inside and appreciate the soft-touch seating while you let the air conditioning keep you wrapped in your ideal temperature. Along with an impressive sound system, cruise control, keyless entry, power door locks, heated exterior mirrors, and power windows, you won't want another vehicle ever again!  Nissan's passion for safety shines through in their equipment list. With steel side-door guard beams, LATCH, child safety locks, and an army of airbags, you won't need to worry about your loved ones when you pile them inside this SUV. Our Nissan has plenty of room for your family and all your gear, so load everyone up and hit the open highway. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2003, :miles=>185987, :transmission=>"Automatic", :color=>"White", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>5375, :newused=>"Used", :vin=>"JN8DR09X53W705244", :stocknumber=>"AAYJ138", :model=>"Pathfinder", :trim=>"SE", :enginedescription=>"3.5L 6 Cylinders", :interiorcolor=>"Tan", :options=>"Audio : Am/Fm Stereo,Audio : Cd Player,Cargo Area Tie-Down Hooks,Cargo Area Under Floor 