Listing.where(vin: '2G2WP552261310357').update_all(:title=>"2006 Pontiac Grand Prix", :description=>"Our 2006 Pontiac Grand Prix is a mid-size sport sedan that touts its versatility as a family car and road performer. This Grand Prix has a 3.8-liter with 200-hp engine and mated to 4-speed automatic with overdrive.  Equipped with standard ABS, traction control, and stability control, power windows and locks, air conditioning, and a driver's information center. An already large trunk can be expanded by folding down the rear seats and the front passenger seat.  2006 Grand Prix owners say that the power is just fun and the pickup and takeoff are unsurpassed. Drivers love the style of the Grand Prix! Handling is good, and all the features for a relatively low price are other standouts. Headroom is limited and rear legroom is only adequate for children if you're in the car for a long time. They even say that gas mileage is pretty decent for this size of car. So stop wasting time and get in here and see this beautiful Grand Prix!   Print this page and call us NOW for your personalized test drive towards ownership!!! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", :city=>"NOT LISTED", :state=>"NOT LISTED", :zipcode=>nil, :category_id=>nil, :subcategory_id=>nil, :latitude=>nil, :longitude=>nil, :user_id=>1072, :image=>nil, :year=>2006, :miles=>98557, :transmission=>"Automatic", :color=>"Crimson Red", :cylinder=>"NOT LISTED", :fuel=>"Gasoline", :drive=>"2WD", :address=>nil, :wholesale=>false, :price=>4999, :newused=>"Used", :vin=>"2G2WP552261310357", :stocknumber=>"BASN128", :model=>"Grand Prix", :trim=>nil, :enginedescription=>"3.8L 6 Cylinders", :interiorcolor=>"Ebony", :options=>"Air Bags, Frontal, Driver And Right Front Passenger (Always Use Safety Belts And Proper Child Restraints, Even With Air Bags. Children Are Safer When Properly Secured In A Rear Seat. See The Owners Manual For More Safety Informatio